import {AiOutlineShoppingCart} from "react-icons/ai"

const Navbar = () => {
  return (
    <div>
      <div className="flex-row justify-between felx">
        <img src="https://static.vecteezy.com/system/resources/previews/003/092/544/original/e-commerce-logo-with-pointer-and-shopping-bag-free-vector.jpg" />
        <div>
          <p>Home</p>
          <AiOutlineShoppingCart />
        </div>
      </div>
    </div>
  )
};

export default Navbar;
